import { ReactNode } from 'react';

import { Text } from 'react-native';

import { Container } from './styles';

interface PageProps {
  children: ReactNode;
}

function Page({ children }: PageProps) {
  return (
    <Container>
      <Text>Page</Text>
      {children}
    </Container>
  );
};

export default Page;
